45a6286116c80bd61362db7bb4e6ef8511b224dc.source:
query Contracts($locale: Locale!) {
  contracts {
    __typename
    displayName
    switchedFromInsuranceProvider
    upcomingRenewal {
      __typename
      renewalDate
      draftCertificateUrl
    }
    perils(locale: $locale) {
      __typename
      ...PerilFragment
    }
    insurableLimits(locale: $locale) {
      __typename
      ...InsurableLimitFragment
    }
    termsAndConditions(locale: $locale) {
      __typename
      displayName
      url
    }
    status {
      __typename
      ... on PendingStatus {
        pendingSince
      }
      ... on ActiveInFutureStatus {
        futureInception
      }
      ... on ActiveStatus {
        pastInception
      }
      ... on ActiveInFutureAndTerminatedInFutureStatus {
        futureInception
        futureTermination
      }
      ... on TerminatedInFutureStatus {
        futureTermination
      }
      ... on TerminatedTodayStatus {
        today
      }
      ... on TerminatedStatus {
        termination
      }
    }
    currentAgreement {
      __typename
      ... on AgreementCore {
        certificateUrl
      }
      ... on SwedishApartmentAgreement {
        activeFrom
        activeTo
        certificateUrl
        numberCoInsured
        address {
          __typename
          street
          postalCode
          city
        }
        squareMeters
        type
        premium {
          __typename
          ...MonetaryAmountFragment
        }
      }
      ... on SwedishHouseAgreement {
        activeFrom
        activeTo
        certificateUrl
        numberCoInsured
        address {
          __typename
          street
          postalCode
          city
        }
        squareMeters
        yearOfConstruction
        ancillaryArea
        isSubleted
        numberOfBathrooms
        extraBuildings {
          __typename
          ...ExtraBuildingFragment
        }
      }
      ... on NorwegianHomeContentAgreement {
        activeFrom
        activeTo
        certificateUrl
        numberCoInsured
        address {
          __typename
          street
          postalCode
          city
        }
        squareMeters
      }
      ... on NorwegianTravelAgreement {
        activeFrom
        activeTo
        certificateUrl
        numberCoInsured
      }
    }
  }
}

